import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const Green = (props) => (
  <div className="green">{props.number}</div>
)
const Blue = (props) => (
  <div className="blue">
    <Green number={props.number} />
  </div>
)


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App">
          <h1> Hello, this is my new app</h1>
        </header>
      </div>
    );
  }
}

export default App;
